import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';

function Header () {
  return (
    <Navbar fixed="top" className="header">
      <Navbar.Brand className="brand" href="/">birdie</Navbar.Brand>
    </Navbar>
  )
}

export default Header
